import Hero from "./Hero";
import image1 from "./images/1.jpg";

const Home = () => {
    return(
      <>

      <Hero text="Welcome to Movie Browser"/>
      
      <div className="container">
        <div className="row">
          <div className="col-lg-8 offset-lg-2 my-0">
            <div className="lead">
              <img src={image1} width="100%"
                height="100%"/>
            
            </div>
          </div>
        </div>
      </div>
      <footer className="footer justify-content-center bg-dark pb-5">
        Developed by Alisha Lohani 2023
      </footer>

      </>
    )
  }
  export default Home;
